import React from "react"
import data from "./data"
import "./Location.css"

function Location(){
    return (
        <div class="location-container">
            <img src={data[0].imageUrl} alt={data[0].imageAlt}/>
            <h1>{data[0].title}</h1>
        </div>
    )
}

export default Location;
